import React, { Component } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

const products = [
  {
    name: 'iPad',
    price: 500
  },
  {
    name: 'iPhone',
    price: 200
  }
];

localStorage.setItem('products',  JSON.stringify(products));

class App extends Component {

  render() {
    return(
      <div className="App">
        <h1>Product Manager</h1>
      </div>
    );
  }
}

export default App;
